import React from "react";
import Search from "./search/Search";
import TransactionLog from "./log/TransactionLog";

const TransactionsDisplay = ({data,displaycount,currentDisplayedData,startposition}) => {
  return (
    <>
      <Search />
      <TransactionLog data={data} displaycount={displaycount} currentDisplayedData={currentDisplayedData}  startposition={startposition} />
    </>
  );
};

export default TransactionsDisplay;
